import React from 'react';
import './LandingPage.css';

const LandingPage = () => {
  return (
    <div className="landing-page">
      <div className="hero-section">
        <div style={{ textAlign: 'center', marginBottom: '40px', marginTop: '-80px' }}>
          <div style={{
            color: 'black', 
            fontSize: '48px', 
            fontFamily: 'Oxygen Mono', 
            fontWeight: 400, 
            wordWrap: 'break-word',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            gap: '12px',
            marginBottom: '16px'
          }}>
            <div style={{width: '24px', height: '24px', position: 'relative', flexShrink: 0}}>
              <div style={{
                width: '24px', 
                height: '24px', 
                border: '2px solid #A2C5F4', 
                borderRadius: '50%', 
                position: 'relative'
              }}>
                <div style={{
                  position: 'absolute',
                  top: '2px',
                  left: '2px',
                  right: '2px',
                  bottom: '2px'
                }}>
                  <div style={{
                    position: 'absolute',
                    top: '0px',
                    left: '50%',
                    width: '1px',
                    height: '9px',
                    backgroundColor: '#A2C5F4',
                    transformOrigin: 'bottom',
                    transform: 'translateX(-50%) rotate(-30deg)'
                  }}></div>
                  <div style={{
                    position: 'absolute',
                    top: '0px',
                    right: '0px',
                    width: '1px',
                    height: '9px',
                    backgroundColor: '#A2C5F4',
                    transformOrigin: 'bottom',
                    transform: 'rotate(30deg)'
                  }}></div>
                  <div style={{
                    position: 'absolute',
                    bottom: '0px',
                    left: '0px',
                    width: '9px',
                    height: '1px',
                    backgroundColor: '#A2C5F4',
                    transformOrigin: 'left',
                    transform: 'rotate(30deg)'
                  }}></div>
                  <div style={{
                    position: 'absolute',
                    bottom: '0px',
                    right: '0px',
                    width: '9px',
                    height: '1px',
                    backgroundColor: '#A2C5F4',
                    transformOrigin: 'right',
                    transform: 'rotate(-30deg)'
                  }}></div>
                  <div style={{
                    position: 'absolute',
                    top: '50%',
                    left: '0px',
                    width: '18px',
                    height: '1px',
                    backgroundColor: '#A2C5F4',
                    transform: 'translateY(-50%)'
                  }}></div>
                </div>
              </div>
            </div>
            eigenverse 
          </div>
          <div style={{
            color: 'black', 
            fontSize: '16px', 
            fontFamily: 'Play', 
            fontWeight: 400, 
            wordWrap: 'break-word'
          }}>
            Turning scary equations into aha moments.
          </div>
        </div>

        <div style={{
          display: 'flex',
          gap: '40px',
          marginBottom: '80px'
        }}>
          <button 
            onMouseEnter={(e) => {
              e.target.style.borderColor = 'rgba(255, 255, 255, 0.9)';
              e.target.style.transform = 'scale(1.05)';
            }}
            onMouseLeave={(e) => {
              e.target.style.borderColor = 'transparent';
              e.target.style.transform = 'scale(1)';
            }}
            style={{
              width: '110px',
              height: '60px',
              background: 'linear-gradient(90deg, #D1E4FD 0%, #D7E6F9 29%)',
              border: '2px solid transparent',
              color: 'black',
              fontSize: '20px',
              fontFamily: 'Oxygen Mono',
              fontWeight: 400,
              cursor: 'pointer',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              transition: 'all 0.2s ease'
            }}>
            learn
          </button>
          <button 
            onMouseEnter={(e) => {
              e.target.style.borderColor = 'rgba(255, 255, 255, 0.9)';
              e.target.style.transform = 'scale(1.05)';
            }}
            onMouseLeave={(e) => {
              e.target.style.borderColor = 'transparent';
              e.target.style.transform = 'scale(1)';
            }}
            style={{
              width: '110px',
              height: '60px',
              background: 'linear-gradient(90deg, #D1E4FD 0%, #D7E6F9 29%)',
              border: '2px solid transparent',
              color: 'black',
              fontSize: '20px',
              fontFamily: 'Oxygen Mono',
              fontWeight: 400,
              cursor: 'pointer',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              transition: 'all 0.2s ease'
            }}>
            log in
          </button>
        </div>

        <div style={{
          color: 'black',
          fontSize: '16px',
          fontFamily: 'Play',
          fontWeight: 400,
          textAlign: 'center',
          maxWidth: '600px'
        }}>
          Most ML tutorials skip the math. Most math texts skip the ML. We connect the two.
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
